import React from 'react';

const CompForm = () => {
  return (
    <form>
      <div className='radios'>
        <label><i class="fa-solid fa-venus-mars"></i>성별을 입력하세요</label>
        <p>
          <input id="tall" type="radio" name='gender' required />
          <label htmlFor="mail">mail</label>
          <input id="tall" type="radio" name='gender' required />
          <label htmlFor="femail">femail</label>
        </p>
      </div>
      <div>
        <label htmlFor="tall"><i class="fa-solid fa-ruler-vertical"></i>신장을 입력하세요</label>
        <input id="tall" type="number" required placeholder='cm단위로 입력해주세요' />
      </div>
      <div>
        <label htmlFor="weight"><i class="fa-solid fa-weight-scale"></i>체중을 입력하세요</label>
        <input id="tall" type="number" required placeholder='kg단위로 입력해주세요' />
      </div>
      <button>측정하기</button>
    </form>
  );
};

export default CompForm;
